Complesso immobiliare all'asta in via guascona 42 di 498 mq di cui 2 porzioni di fabbricati da 111 mq, un fabbricato di 104 mq e un deposito di 172 mq, oltre 116 mq di 3box auto, posto su due livelli. Si tratta di 3 porzioni di corpo di fabbrica, locale deposito, tre box (di cui uno con quattro accessi carrai), così composti --> 
a. porzione di corpo di fabbrica, a cui si accede dall’area cortilizia/giardino e da corte comune sul retro costituita da piano terra composto da ingresso con ampia scala a chiocciola al piano primo, cucina, bagno e soggiorno; al piano primo ampio locale disimpegno di arrivo della scala a chiocciola, tre camere, spogliatoio e bagno; 
b. porzione di corpo di fabbrica al piano primo, con unico accesso da locale disimpegno, costituito da soggiorno, cucina, corridoio
